  \"2013-03-14T15:11:38.550658\",\n\t\"name\": \"digital-geologic-map-file-footprints\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Digital Geologic Quadrangle Maps (DGM)
  series is a collection of geologic maps produced at a 1:24,000 scale. Most of these
  maps were produced in cooperation with the USGS through Cooperative Geologic Mapping
  Programs. Each map contains geologic formation contacts, fault, structure, and attitude
  of bedding (strike and dip) data at a 1:24,000 scale. Also included on most of the
  maps are a cross-section, correlation and description of map units, references,
  and a stratigraphic column for the quadrangle.\",\n\t\"license_title\": null,\n\t\"extras\":
